import { Alert, Card, Container, Divider, Typography } from "@mui/material";
import Layout from "../components/layout/Layout";

const NotFoundPage = () => {
  return (
    <Layout>
      <Alert severity="error">
        <Typography>Page not found!</Typography>
        <Divider />
        <a href="/">Go to our starting page</a>
      </Alert>
    </Layout>
  );
};

export default NotFoundPage;
